import React, { useState } from 'react';
import DatePicker from 'react-datepicker';

import 'react-datepicker/dist/react-datepicker.css';

const InputDateTime = () => {
  const [checkInDate, setCheckInDate] = useState(new Date());
  const [checkOutDate, setCheckOutDate] = useState(null);

  const handleCheckInDate = (date: any) => {
    setCheckInDate(date);
    setCheckOutDate(null);
  };

  const handleCheckOutDate = (date: any) => {
    setCheckOutDate(date);
  };

  return (
    <div className="input-container">
      <div>
        <label>Check-in</label>
        <DatePicker selected={checkInDate} minDate={new Date()} onChange={handleCheckInDate} />
      </div>
      <div>
        <label>Check-out</label>
        <DatePicker selected={checkOutDate} minDate={checkInDate} onChange={handleCheckOutDate} />
      </div>
    </div>
  );
};

export default InputDateTime;
